import css from "./styles.scss";
import Link from 'next/link'
import Slider from "react-slick";
import CardProfile from "../../components/CardProfile";

export default function SliderProfile() {
	const profiles = [{
		id: 1,
		name: '셀럽이름',
		avatar: '/static/images/profile_1.png'
	}, {
		id: 2,
		name: '셀럽이름',
		avatar: '/static/images/profile_2.png'
	}, {
		id: 3,
		name: '셀럽이름',
		avatar: '/static/images/profile_3.png'
	}, {
		id: 4,
		name: '셀럽이름',
		avatar: '/static/images/profile_4.png'
	}, {
		id: 5,
		name: '셀럽이름',
		avatar: '/static/images/profile_5.png'
	}, {
		id: 6,
		name: '셀럽이름',
		avatar: '/static/images/profile_6.png'
	}, {
		id: 7,
		name: '셀럽이름',
		avatar: '/static/images/profile_7.png'
	}]
	return (
		<div className={css.profiles}>
			<h2>Lorem ipsum dolor sit amet, consectetur</h2>
			<Slider dots={false} slidesToShow={4}>
				{profiles.map(profile => <CardProfile key={profile.id} profile={profile} />)}
			</Slider>
		</div>
	);
}
